import React from 'react';
import { withRouter, useHistory } from 'react-router-dom';

function Main() {

    function login() {
        history.push('/signin')
    }

    return (
        <div className="login">
            <button onClick={login} className="login__button">Войти</button>
            <button className="login__button">Просмотр</button>
        </div>
    );
}

export default withRouter(Main);
